import React from 'react';

function deleteHandler(){
    console.log('clicked!');
    console.log({text});
}
const Todo = ({text}) => {
  return (
    <div className='card'>
        <h2>{text}</h2>
        <div className='actions'>
          <button onClick={deleteHandler} className='btn' >Delete</button>
        </div>
      </div>
  )
}

export default Todo
